import React from 'react';
import './HamburgerMenu.scss';

class HamburgerMenu extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      showMenu: false
    };
  }

  handleMenuClick() {
    this.props.handleMenuClick();
    this.setState(state => ({
      showMenu: !showMenu
    }));
  }

  render() {
    return (
      <svg width={this.props.width} height={this.props.height} viewBox="0 0 14 14" className="hamburger-menu" onClick={this.props.onClick}>
        <path stroke={this.props.stroke} d="M2 4 h10 M2 7 h10 M2 10 h10" />
      </svg>
    );
  }
}

export default HamburgerMenu;
